import React from 'react';
import { Box, Typography, Button, Container } from '@mui/material';

const HeroSection = () => {
  return (
    <Box sx={{ bgcolor: 'primary.main', color: 'white', py: 8, textAlign: 'center' }}>
      <Container>
        <Typography variant="h2" gutterBottom>
          Welcome to Hono Technology
        </Typography>
        <Typography variant="h5" gutterBottom>
          Empowering your career with cutting-edge IT solutions and Zvertex AI.
        </Typography>
        <Button variant="contained" color="secondary" href="https://zvertexai.com" target="_blank">
          Explore Zvertex AI
        </Button>
      </Container>
    </Box>
  );
};

export default HeroSection;
